import { Link } from "react-router-dom";


const InputIncome = () => {


    return(
        <div className="inputIncomePage">
            <div>
                <Link to="/input_spend">Spend</Link>
                <Link to="/input_income">Income</Link>
            </div>
            <div className="inputBox_grid">
                <button id="salay"></button>
                <button id="bonus"></button>
                <button id="sideline"></button>
                <button id="inves"></button>
                <button id="allowance"></button>
                <button id="stock"></button>
                <button id="tips"></button>
                <button id="othersIn"></button>
            </div>
        </div>
    );
}

export default InputIncome;
